description:
In a peaceful forest, the remains of a picnic trigger a ruthless war between rival ant colonies, obsessed
with gaining control of the same prize: a box of sugar cubes! Amidst this struggle a young ladybug befriends a black ant and helps him
save his people from the horrible red ants...

